  false,\n\t\"url\": null,\n\t\"notes\": \"Iraqi upper air records loaned to NCDC
  from the Air Force 14th Weather Squadron. Scanned notebooks containing upper air
  radiosonde launch records and data. Launches were conduced by the Iraqi Meteorological
  Department. Most textual information is in Arabic. Records were collected by the
  United States Air Force and used as reference for flights during Operation Desert
  Storm in 1990-1993. Each notebook is scanned into a single file, spanning two to
  12 months. Period of record is 1958-1989\",\n\t\"license_title\": null,\n\t\"extras\":
